import './index.scss';
import {Link, NavLink, useNavigate} from "react-router-dom";

const Navbar = () => (
    <section id={ 'nav' }>
        <NavLink to={ '/' } id={ 'logo' }>
            Card Me Daddy
        </NavLink>

        <form className={ 'change-name' }>
            <input type={ 'text' } placeholder={ 'placeholder for now' } />
            <input type={ 'submit' } value={ 'Change Name' }/>
        </form>
    </section>
);

export default Navbar;
